import React from "react";

function App() {
  let count = 0;

  const increase = () => {
    count++;
    console.log("I got clicked!")
    ReactDOM.render(
      <div className="container">
        <h1>{count}</h1>
        <button onClick={increase}>+</button>
      </div>,
      document.getElementById("root")
    );
  }
}




export default App;
